import React from 'react';
import './css/Goals.css'; // Стилі для Goals

const goalsData = [
  {
    imgSrc: 'img/goal1.jpg',
    title: 'Піти в спортзал',
  },
  {
    imgSrc: 'img/goal2.webp',
    title: 'Купити новий телефон',
  },
  {
    imgSrc: 'img/goal3.jpg',
    title: 'Поїхати в Італію',
  },
  {
    imgSrc: 'img/goal4.jpg',
    title: 'Прочитати три книги',
  },
  {
    imgSrc: 'img/goal5.jpg',
    title: 'Навчитися грати на гітарі',
  },
  {
    imgSrc: 'img/goal6.jpg',
    title: 'Купити навушники',
  },
  {
    imgSrc: 'img/goal7.png',
    title: 'Здати IELTS',
  },
  {
    imgSrc: 'img/goal8.jpg',
    title: 'Купити сережки',
  },
  {
    imgSrc: 'img/goal9.webp',
    title: 'Купити духи',
  },
  {
    imgSrc: 'img/goal10.webp',
    title: 'Освоїти html і css',
  },
  {
    imgSrc: 'img/goal11.webp',
    title: 'Купити Porsche',
  },
  {
    imgSrc: 'img/goal12.jpeg',
    title: 'Купити Dyson',
  }
];

function Goals() {
  return (
    <section id="goals">
      <div className="goal-cards">
        {goalsData.map((goal, index) => (
          <article className="goal-card" key={index}>
            <img src={goal.imgSrc} alt={goal.title} />
            <h3>{goal.title}</h3>
            <button className="mark-done">Виконати ціль</button>
            <button className="delete-goal">✖</button>
          </article>
        ))}
        <article className="goal-card add-goal">
          <div className="plus-sign">+</div>
          <h3>Додати ціль</h3>
        </article>
      </div>
    </section>
  );
}

export default Goals;
